window.getImageUrls=function getImageUrls(pageNum){pageNum=(typeof pageNum==='undefined')?67:pageNum;const urls=[];for(let i=1;i<pageNum;i++){const articleCollection=document.getElementById("assets").getElementsByTagName('article');const articles=[...articleCollection];articles.forEach(article=>{url=article.getAttribute("data-thumb-url");urls.push(url)});document.getElementById("next-gallery-page").click()}
return urls}